void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = (fragCoord*2.-iResolution.xy)/iResolution.y;

    float d = length(uv);
    d=sin(4.*d + 2.*sin(iTime));
    d=abs(d);
    float e = cos(length(uv)+1.7*iTime);
    float f = tan(length(uv)+1.7*-iTime);

    // Output to screen
    fragColor = vec4(.07/f,.03/e,.06/d,1.0);

}
